import React, {Component} from 'react';;

export default class Skills extends Component{
    render() {
      return (
        <>
        <div id="skills" className="row skill">
          <div className="three columns header-col">
            <h1 className="skills--heading"><span>Skills</span></h1>
          </div>
          <div className="nine columns main-col">
            <p className="skills--paragraph">Below you will see in what programming language I am most efficiant in. 
            </p>
            <div className="bars">
              <ul className="skills">
                <li><span className="bar-expand css" />90%<em>CSS</em></li>
                <li><span className="bar-expand html5" /><em>HTML5</em></li>
                <li><span className="bar-expand javascript" /><em>JavaScript</em></li>
                <li><span className="bar-expand react" /><em>React</em></li>
                <li><span className="bar-expand jquery" /><em>jQuery</em></li>
              </ul>
            </div>{/* end skill-bars */}
          </div> {/* main-col end */}
        </div> 
        </>
      );
    }
  };
